$(function () {
  showList();
  list();
});
function showList() {
  let html = "";
  //   console.log(ser_all);
  ser_all.forEach((item, index) => {
    html += `<li data-index="${index}"><a href="#">${item.classify}</a></li>`;
  });
  $(".nav-ul").html(html);
}
function list() {
  let arr = ser_all[0].list;
  console.log(arr[0]);
  $(".top").css("background-color", arr[0].col);
  $(".typeface").text(arr[0].name);
  $(".images").html(arr[0].icons);
  let html = "";
  arr.forEach((item, index) => {
    html += `  <div class="box_s">
      <div class="icon_s">
      ${item.icon}</div>
      <span>${item.name}</span>
    </div>`;
  });
  $(".con-content-con").html(html);
}
$(".nav-ul").on("click", "li a", function () {
  $(this)
    .css("border-bottom", "2px solid rgb(36, 85, 126)")
    .parent()
    .siblings()
    .children()
    .css("border-bottom", "none");
  //   console.log($(this).parent().index());
  let indexs = $(this).parent().index();
  let serin = ser_all[indexs].list;
  let html = "";
  serin.forEach((item, index) => {
    html += `  <div class="box_s">
      <div class="icon_s">
      ${item.icon}</div>
      <span>${item.name}</span>
    </div>`;
  });
  $(".con-content-con").html(html);
});
$(".audio_options").on("click", function () {
  if ($(".audio_options").text() == "+") {
    $(".audio_options").text("×");
    $(".option_s").css("display", "block");
  } else if ($(".audio_options").text() == "×") {
    $(".audio_options").text("+");
    $(".option_s").css("display", "none");
  }
});
